import React from "react";
import "./ResourceTable.css";
import ResourcePage from "../ResourcePage/ResourcePage";
const ResourceTable = ({ resources, onRowClick }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Resource Name</th>
          <th>Resource Code</th>
          <th>Description</th>
          <th>Creation Date</th>
          <th>Modified Date</th>
          <th>Cost</th>
        </tr>
      </thead>
      <tbody>
        {resources.map((resource) => (
          <tr key={resource.id} onClick={() => onRowClick(resource)}>
            <td>{resource.resourceName}</td>
            <td>{resource.resourceDetails?.resourceCode}</td>
            <td>{resource.resourceDetails?.resourceDescription}</td>
            <td>{resource.resourceDetails?.creationDate}</td>
            <td>{resource.resourceDetails?.modifiedDate}</td>
            <td>{resource.resourceDetails?.resourceCost}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ResourceTable;
